import React from 'react';
import './SymbolCard.scss';
import { ReactSVG } from 'react-svg'
import caret from '../../assets/caret.svg';
import ArrowUp from '../../assets/arrow-up.svg';
import ArrowDown from '../../assets/arrow-down.svg';


function SymbolCard(props) {
  const arrows = {
    up: ArrowUp,
    down: ArrowDown
  }
  var data = {
    open: props.data['1. open:']
  }
  return (
    <div className="card shadow">
      <div className={"slider trending-" + props.trending}>
        <div className="scale">
          <ReactSVG src={caret} className="triangle" />
          <div className="bar"></div>
        </div>
        <div className="labels">
          <div>2134</div>
          <div>1234</div>
        </div>
      </div>

      <div className="body">
        <div className="symbol-name">
          <div className="title">alphabet inc. cl c</div>
          <div className="symbol">goog</div>
        </div>
        <div className="current-price">
          <div className="value">
            706.32
          </div>
          <div className="trend">
            <div className="points">
              <div className={"arrow trending-" + props.trending}>
                <ReactSVG src={arrows[props.trending]} className={props.trending} />
              </div>
              <div className={props.trending}>15.32 (2.22%)</div>
            </div>
          </div>
        </div>
        <div className="splits">OPEN <span>1.37</span> HIGH <span>1.74</span> LOW <span>1.5</span></div>
      </div>
    </div>
  );
}

export default SymbolCard;
